Can't group when $$ROOT has no results. (MongoDB)<p>I'm trying to score/rank some search results. </p>

<p>Generally this works:
(<code>userIds</code> here is a set of IDs representing the users we want scored/ranked and <code>SomeModel</code> contains assets associated with those users that give us a sorting criteria.)</p>

<pre><code>SomeModel.aggregate([
{$match: {ownerId: {$in:userIds}}},
//Do stuff here to generate a score for the results. This works fine...

...

//at this point you'll have an array like this: {userId:&lt;id&gt;, score:&lt;number&gt;}[]

//push all those results into a field called 'origin' so we can add another
//field with the full set if IDs, merge them, and return them...
{$group: {
_id:0,
origin: {
$push: '$$ROOT'
}
}},

//Add back the full set with project, giving a score of 0 for each.

...

]).then( results =&gt; {
//enjoy your results that include all matched IDs plus the
//non-matched ones, who then get a score of 0.
});
</code></pre>

<p>This all works fine as long as the first <code>$match</code> returns some results.  If that <code>$match</code> doesn't return any results, the <code>$group</code> step doesn't seem to produce anything at all, as where I'd expect it to at least return:</p>

<pre><code>{
_id:0,
origin:[]
}
</code></pre>

<p>...but it doesn't.  If I look at my results at this point I just get <code>[]</code>.</p>

<p>I have tried to change that <code>$group</code> step to check for this like this:</p>

<pre><code>            {$group: { //make these an array so we can merge it....
                _id:0,
                origin: {
                    $push :{
                        $cond:{
                            if: {$eq:[{$size : '$$ROOT'}, 0]},
                            then: [null],
                            else: '$$ROOT'
                        }
                    }
                }
            }},
</code></pre>

<p>...but then I get the error "The argument to $size must be an array, but was of type: object".</p>

<p>What is the correct way to do this?  To be clear, I want to create a container object that holds the results up that point in the pipeline as an array in the field <code>origin</code>.  (Then I'm able to concatenate these with the full list I started with and get a proper sorted list).</p>

<p>This works if the pipeline currently contains results, but if it doesn't the group step does nothing.</p>

<p><strong>Desired inputs / outputs:</strong></p>

<p>My problem is specifically with the <code>$group</code> stage so I'll focus on that.</p>

<p><strong><em>Example 1:</em></strong>
This example is working correctly with the above code.</p>

<p>input:</p>

<pre><code>[ {ownerId: &lt;ID A&gt;, score: 234}, {ownerId: &lt;ID B&gt;, score: 265}]
</code></pre>

<p><code>$group</code></p>

<p>Desired output:</p>

<pre><code>[{
    _id:0,
    origin:[ {ownerId: &lt;ID A&gt;, score: 234}, {ownerId: &lt;ID B&gt;, score: 265}]

}]
</code></pre>

<p>Actual output: Matches!</p>

<p><strong><em>Example 2:</em></strong>
This example is NOT working correctly with the above code.</p>

<p>input:</p>

<pre><code>[]
</code></pre>

<p><code>$group</code></p>

<p>Desired output:</p>

<pre><code>[{
    _id:0,
    origin:[]

}]
</code></pre>

<p>Actual output:</p>

<pre><code>[]
</code></pre>

