async csv To JSON data output in nodejs<p>I have a terrible misunderstanding with promises in nodejs.
I have a function in a module to convert CSV to JSON:</p>

<pre><code>const URL_01 = `${__dirname}/URL/some_CSV.csv`;

const fs = require('fs'),
  Converter = require('csvtojson').Converter,
  converter = new Converter({}),

  convertToJson = function(file) {
    return new Promise( (res, rej) =&gt; {
      converter.on("end_parsed", (jsonData) =&gt; {
        if(!jsonData){
          rej("CSV to JSON conversion failed!")
        }
        res(jsonData);
      });
      fs.createReadStream(file).pipe(converter);
    });
  };

export default convertToJson;
</code></pre>

<p>Then I need to launch function convertToJson with CSVfile_URL in a server.js and save it to mongo db, now no data is output:</p>

<pre><code>    app.get('/all', async (req, res) =&gt; {
  const data = await convertToJson( URL_01 );
  res.send(data);
});
</code></pre>

<p>Who could help me?</p>

