MongoDB: Set value in collection depending on other object<h2>Problem</h2>

<p>A document looks like this:</p>

<pre><code>{
  data: [
    { identifier: 'a', value: 10 },
    { identifier: 'b', value: 53 },
    { identifier: 'c', value: 16 }
  ]
}
</code></pre>

<p>I'd like to set all values to <code>null</code> if another object inside the same array with identifier <code>x</code> meets a condition. Real life example:</p>

<p>If property <code>value</code> of object with identifier <code>a</code> is greater than <code>9</code>, set property <code>value</code> of objects with identifier <code>b</code> or <code>c</code> to <code>null</code>.</p>

<h2>Approach</h2>

<p>I'm trying it with a <code>$project</code> pipeline but don't know how to find other objects.</p>

<pre><code>// ... Rest
{
$unwind: '$data'
}, {
$project: {
  data: {
    identifier: 1,
    value: {
      $cond: {
        if: {}, // Implement
        then: null, // Only valid for current value
        else: '$row.value'
      }
    }
  }
}
// ... Rest
</code></pre>

<h2>Wanted output</h2>

<p>The resulting aggregation should be an array.</p>

<p>If the value of <code>a</code> respects the condition:</p>

<pre><code>[
  { data: { identifier: 'a', value: null } },
  { data: { identifier: 'b', value: null } },
  { data: { identifier: 'c', value: null } },
  // ... more documents
]
</code></pre>

<p>If the value of <code>a</code> doesn't respect the condition:</p>

<pre><code>[
  { data: { identifier: 'a', value: 10 } },
  { data: { identifier: 'b', value: 53 } },
  { data: { identifier: 'c', value: 16 } },
  // ... more documents
]
</code></pre>

