How to use arrays as filters by querying subdocuments<p>I have the following document structure on my mongodb collection: </p>

<pre><code>{
"_id" : "5Ci9sLeBu2iPbWtR5",
"productId" : "010101111",
"description" : "PRODUCT EXAMPLE REF 1001",
"prices" : [ 
    {
        "priceId" : 10,
        "description" : "Promotions",
        "price" : 97.99
    },
    {
        "priceId" : 15,
        "description" : "Retail list",
        "price" : 105.65
    },
    {
        "priceId" : 20,
        "description" : "Standard list",
        "price" : 109.10
    }
]}
</code></pre>

<p>What I want is query only specific array of priceIds, for example: [10,20], resulting:</p>

<pre><code>{
"_id" : "5Ci9sLeBu2iPbWtR5",
"productId" : "010101111",
"description" : "PRODUCT EXAMPLE REF 1001",
"prices" : [ 
    {
        "priceId" : 10,
        "description" : "Promotions",
        "price" : 97.99
    },
    {
        "priceId" : 20,
        "description" : "Standard list",
        "price" : 109.10
    }
]}
</code></pre>

<p>Using <strong>$in</strong> operator with <strong>$filter</strong> like this (the perfect imaginary scenario):</p>

<pre><code>db.getCollection('products').aggregate([
{$match: { "productId":"010101111" }},
{$project: { 
    "prices": {
        $filter: {
            input: "$prices",
            as: "price",
            cond: { $in: ["$$price.priceId",[10, 20]] }
        }
    }
}}])
</code></pre>

<p>it doesn't work, because mongodb complains about $in operator ("invalid operator '$in'").</p>

<p>Of course, I can do that with <strong>$unwind</strong>, but I'll have a performance problem, because I need to group again after all.</p>

<p>The closest answers I've found for my question were these two: </p>

<ol>
<li><a href="https://stackoverflow.com/questions/3985214/retrieve-only-the-queried-element-in-an-object-array-in-mongodb-collection">Retrieve only the queried element in an object array in MongoDB collection</a></li>
<li><a href="https://stackoverflow.com/questions/39444888/filter-array-using-the-in-operator-in-the-project-stage">Filter array using the $in operator in the $project stage</a></li>
</ol>

<p>but none of them were about searching with array filter in subdocuments.</p>

